import React from 'react';
import { withService } from '../hoc';
import {Home, Item} from '../'
import './app.css';

const App = ({shopService}) =>{
    const item = shopService.getItem();
    return(
        <div> 
            <p>
                My new store!
                <br/>
                {item}
            </p>
            <br/>
        </div>
    )
}
export default withService()(App);
